import React from "react";

export function Input(props) {
  return (
    <div className="form-group">
      <input className="form-control" {...props} style={{width}} />
    </div>
  );
}



export function FormBtn(props) {
  return (
    <button {...props} style={{marginBottom: 20, width: 600 }} className="btn btn-success">
      {props.children}
    </button>
  );
}
